import classes from "./Skills.module.css";

const Skills = () => {
  const td =
    ({
      name: "Javascript",
    },
    {
      name: "Reactjs",
    });
  //   name: ,
  //   "",
  //   "HTML",
  //   "CSS",
  //   "GIT",
  //   "JSON",
  //   "SASS",
  //   "Figma",
  //   "Github",
  //   "Bootstrap",
  //   "Responsive Design",
  // ];
  td.map((item) => {
    return <td>{item.name}</td>;
  });
  return (
    <div className={classes.container}>
      <table>
        <tbody>
          <tr className={classes.tr}>
            <td>Javascript</td>
            <td>Reactjs</td>
            <td>HTML</td>
            <td>CSS</td>
            <td>GIT</td>
            <td>JSON</td>
            <td>SASS</td>
            <td>Figma</td>
            <td>Github</td>
            <td>Bootstrap</td>
            <td>Responsive Design</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Skills;
